import React, { Component } from 'react'
import Navbar from './components/Navbar'
import Sidebar from './components/Sidebar'
import Profile from './pages/Profile'

export default class App extends Component {
    state = {
        sidebar: true,
        dropdown: false,
    }

    render() {
        return (
            <>
                <Navbar app={this} />
                <Sidebar app={this} />
                <div className="body">
                    <Profile />
                </div>
            </>
        )
    }
}
